import React from 'react';
import './GameSquare.css';


const GameSquare = (on) => {
  return (
    isOn ? 
    <div className="GameSquare ON" on={isOn}>
    </div> :
    <div className="GameSquare OFF" on={isOn}>
    </div>
  )
} 

export default GameSquare;
